css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 0.5rem 1.5rem;
  text-align: center;
  font-weight: 600;
  color: #788b9b;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #20252a;
  background-color: #2d353b;
}
.github-tab-icon {
  color: #4e5b66;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #3c464f;
  border-radius: 4px;
  padding: 0 .25em;
  margin-left: 0.5rem;
}
.github-tab.react-tabs__tab--selected {
  color: #f9fafb;
  box-shadow: 0 1px 0 #3a444d;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #91a7bb;
}
